import classes from "./EducationContent.module.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { Icon } from "@iconify/react";



const EducationContent = () => {
  return (
    <div>
      <div>
        <div className={classes.degree}>
          <img
            src="https://www.freepnglogos.com/uploads/graduation-cap/graduation-cap-clipart-invenio-30.png"
            width="450"
            alt="graduation cap transparent download best graduation"
          />
        </div>
        <div>
          <div className={classes.degreecontent}>
            <h2>Education</h2>
            <h3>Basic Qualification and Certifications</h3>
            <div >
                <a href="https://www.codechef.com/users/shashi_k" target="_blank"> <Icon icon="simple-icons:codechef" color="#313740" width="80" height="70" /> </a>
                <a href="https://www.codechef.com/users/shashi_k" target="_blank"> <Icon icon="simple-icons:hackerrank" color="#313740" width="80" height="70" /> </a>
                <a href="https://www.codechef.com/users/shashi_k" target="_blank"> <FontAwesomeIcon icon="fa-brands fa-google"/> </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default EducationContent;
